class http_client(object):
    """
    用于调用开源大模型进行会话通过端口透传
    """

    # 初始化
    def __init__(self, base_url, apiKey):
        self.apiKey = apiKey
        self.host = urlparse(base_url).hostname
        self.base_url = base_url
        self.path = urlparse(base_url).path
        self.content_type = "application/json"
        self.request_method = "POST"

    # 发送数据
    def run(self, content):
        data = json.dumps(content)
        self.digest = self.sign_body(data)
        print("请求入参：", data)
        headers = self.auth_headers()
        urllib3.disable_warnings(
            urllib3.exceptions.InsecureRequestWarning)  # 关闭警告
        try:
            response = requests.request(self.request_method,
                                        self.base_url,
                                        data=data,
                                        headers=headers,
                                        verify=False)
        except Exception as e:
            print("请求异常：", e)
            return None

        else:
            result = response.text
            print("响应参数：", result)
            return result

    def sign_body(self, body):
        if body is None or len(body) == 0:
            raise ValueError("body is empty.")
        sha256 = hashlib.sha256()
        sha256.update(body.encode("utf-8"))
        digest = sha256.digest()
        signature = base64.b64encode(digest).decode("utf-8")
        return signature

    # 生成认证头信息
    def auth_headers(self):
        authorization = "Bearer " + self.apiKey

        ## 将请求的鉴权参数组合为字典
        headers = {
            "Authorization": authorization,
            "Content-Type": self.content_type,
        }
        print("请求头信息headers:", headers)
        return headers

    
# 生成请求参数
